      <description><![CDATA[<p>i am working on my dads acoustic project and as i have only ever messed with hardcore and metal, im kinda lost. <br /> <br /> his music is very folky to the style of bob dylan or neil young and i am trying to emulate that sound. <br /> <br /> also the tracks that he gave me seem to clip quite a bit, is there any way to solve this or should i just re record him on my set up? ( the original recordings were done by him on an old 8 track mixer/harddrive.) <br /> <br /> <br /> thank you for your time <br /> <br />PS i am really looking forward to remy's response, i always find what you have to say useful. you have a great way of explaining things and it helps out the newbies like me a ton. /end buttkissing</p>]]></description>
      <pubDate>Thu, 01 Jan 1970 02:33:29 +0200</pubDate>
    </item>
    <item>
      <title><![CDATA[I have a computer with a soundcard, can I record my songs on it?]]></title>
      <link>http://recordingquestion.andreyd.forma-dev.com</link>
      <description><![CDATA[<p>Sure. How well depends upon several things. First, how fast is your computer? I recommend a Pentium class machine running at 450 mhz or better. Of course, faster is better. Also, you will need a large hard drive, wave files take a lot of space (10 meg for 1 minute of stereo).</p>]]></description>
      <pubDate>Thu, 01 Jan 1970 02:33:29 +0200</pubDate>
    </item>
    <item>
      <title><![CDATA[What's the correct position of SRC in the Mastering Chain?]]></title>
      <link>http://recordingquestion.andreyd.forma-dev.com</link>
      <description><![CDATA[<p>Hello my question is  <br /> <br /> When should I convert to 44,1 kHz when product should be an Audio CD ? <br /> Before my Mastering-Chain or as the last step in Mastering, before Dithering. <br /> <br /> <a href="http://src.infinitewave.ca/" target="_blank">http://src.infinitewave.ca/</a> is an interesting link on Tests for this ite.</p>]]></description>
      <pubDate>Thu, 01 Jan 1970 02:33:29 +0200</pubDate>
    </item>
    <item>
      <title><![CDATA[Mastering Recommendations?]]></title>
      <link>http://recordingquestion.andreyd.forma-dev.com</link>
      <description><![CDATA[<p>I am finishing up an R&amp;B / Urban Pop album and am in need of a reputable mastering house. I am definitely on a budget, but for reference, several of my favorite albums were mastered by Brian Gardner at Bernie Grundman and Chris Gehringer at Sterling Sound. <br /> <br />Below are two wav files mixed to 16-Bit 44.1kHz around -5dB. They are rough mixes just to demonstrate the music. One file is dry and the other has Waves Plug-Ins on the Main Bus. As you may be able to ascertain, the album has a sci-fi/space feel. <br /> <span style="font-weight: bold;"> <br /> &middot;<a class="postlink" href="http://www.zachkarl.com/masteringdemos/voyager_album_mastering_demo_dry.wav" target="_blank">5trk Mastering Demo Dry 26.71MB 2:35 wav</a> <br /> <br /> &middot;<a class="postlink" href="http://www.zachkarl.com/masteringdemos/voyager_album_mastering_demo_wplugins.wav" target="_blank">5trk Mastering Demo wPlugins 26.71MB 2:35 wav</a> <br /> <br /> Budget: &lt; $1,000 <br /> </span> <br /> &middot;17 Tracks (First track is only 44 seconds and only features a computer voice and a few Sound Idea effects&mdash;no music) <br /> <br /> &middot;55 to 60 minutes sequenced and gapless <br /> <br /> &middot;24-Bit, 48kHz <br /> <br /> &middot;Plenty of headroom <br /> <br /> &middot;Will deliver week of April 13th with UPC and ISRC Codes (Currently finishing up recording and mixing) <br /> <br /> &middot;Interested in possibility of separations, but it&rsquo;s not a must <br /> <br /> &middot;Possibility of one or two instrumental versions (for singles) <br /> <br /> <span style="font-weight: bold;">What I am looking for in mastering:</span> <br /> <br /> &middot;Informed use of compression, limiting, and EQ (I have access to great plug-ins but don&rsquo;t want to just slap a bunch of stuff on the main bus) <br /> <br /> &middot;Consistency between tracks <br /> <br /> &middot;Good translation on multiple listening systems (i.e. consumer headphones to higher end systems) <br /> <br /> &middot;Loud is okay, but I don&rsquo;t want to completely kill the dynamics</p>]]></description>
      <pubDate>Thu, 01 Jan 1970 02:33:29 +0200</pubDate>
    </item>
