    <item>
      <title><![CDATA[How can you record the sound coming through your sound card in Windows when you are using a Realtek HD sound card and don't have sterio mix in your volume control properties realtek input?]]></title>
      <link>http://recordingquestion.andreyd.forma-dev.com</link>
      <description><![CDATA[<p>First, before we move on, make sure that you have windows up to date and all the latest drivers for your device. <br /><br /> OK, for starters, if you have windows vista try this: <br /> In windows vista, the "stereo mix" is disabled by default. It being a virtual sound card, most people have trouble finding how to to enable it seeing as it does not show up in device manager. To enable the virtual sound card in Windows Vista, open the control panel, then sound: Control Panel--&gt;Sound--&gt;Recording Tab. Now right click the window. You should have two option appear that says "display disabled devices" and "display disconnected devices". Make sure "display disabled devices" is selected. A sound card called "stereo mix" should appear. Open the device properties and enable. You should then have your stereo mix in the audio control. Should should then be able to select that sound card from the list in your recording software's settings. (You may have to restart your computer first.) <br /><br /> If you are using a version of windows other than vista, or if you are using a laptop and want to record a stereo mix without playing audio through your speakers there is a great program out the called "Virtual Audio Cable" (VAC). It installs what a virtual sound card on your pc, well sort of... it allows you to set up a virtual patch bay system with multiple audio feeds. You could set the VAC output device as your primary sound card, then record from it. I will include a better description as well a a link to this software. The only downside is it cost $30 USD, but in my opinion, this someware is worth the price if you are doing a lot of recording. <br /><br /> A third alternative to buying software would be VLC media player. VLC media player has the option of saving any open streams to almost any file type. It opens streams from web streams, local files, as well as audio and video devices. It can also be conersed into converting files very nicely although this may take some practice will file formats, etc. It's free. I will include a link.</p>]]></description>
      <pubDate>Thu, 01 Jan 1970 02:33:29 +0200</pubDate>
    </item>
